    false,nt"url": null,nt"notes": "A joint effort of the Department of Fish
    and' Game and the U. S. Bureau of  Sport Fisheries and Wildlife contained botulism
    losses in the southern San  Joaquin Valley to 8,0^3 birds. Approximately 3,170 sick
    birds were treated  with an 86.5 percent recovery. The botulism outbreak was mainly
    a result  of agricultural flooding with water stored from the heavy runoff of the
     previous year. Pintails (Anas acuta) composed 59*2 percent of the dead birds.",nt"owner_org":
